import React from "react";
import "./TablaCocheras.css";
import { FaEdit, FaTrashAlt } from "react-icons/fa";
import CocherasData from "../../config/CocherasData";

const TablaCocheras = () => {
    return (
        <div className="table-container">
            <table className="table">
                <thead>
                <tr>
                    <th>ID Cochera</th>
                    <th>Número de Cochera</th>
                    <th>Ubicación</th>
                    <th>Estado</th>
                    <th>Asignada a</th>
                    <th>Acciones</th>
                </tr>
                </thead>
                <tbody>
                {CocherasData.map((cochera) => (
                    <tr key={cochera.id}>
                        <td>{cochera.id}</td>
                        <td>{cochera.numero}</td>
                        <td>{cochera.ubicacion}</td>
                        <td>
                                <span
                                    className={`estado ${
                                        cochera.estado === "Disponible"
                                            ? "estado-disponible"
                                            : "estado-ocupada"
                                    }`}
                                >
                                    {cochera.estado}
                                </span>
                        </td>
                        <td>{cochera.asignada}</td>
                        <td>
                            <button className="edit-button">
                                <FaEdit />
                            </button>
                            <button className="delete-button">
                                <FaTrashAlt />
                            </button>
                        </td>
                    </tr>
                ))}
                </tbody>
            </table>
        </div>
    );
};

export default TablaCocheras;
